  PRIMARY KEY (`ID`) USING BTREE,
  UNIQUE INDEX `employee_UN`(`CODE`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 101 CHARACTER SET = utf8 COLLATE = utf8_vietnamese_ci COMMENT = 'Danh mục Nhân viên' ROW_FORMAT = Compact;

