-- ----------------------------
-- Table structure for product
-- ----------------------------
DROP TABLE IF EXISTS `product`;
CREATE TABLE `product`  (
  `ID` bigint(20) NOT NULL AUTO_INCREMENT COMMENT 'ID sản phẩm',
  `CODE` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT 'Mã sản phẩm',
  `NAME` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT 'Tên sản phẩm',
  `TYPE_ID` int(11) NULL DEFAULT NULL COMMENT 'ID Loại sản phẩm (lấy theo ID từ bảng app_params)\r\n------\r\nselect ap.ID\r\nfrom app_params ap\r\nwhere ap.IS_ACTIVE = 1\r\n	and ap.TYPE = \'PRODUCT_TYPE\'\r\norder by ap.PAR_ORDER;',
  `BRAND_ID` int(11) NULL DEFAULT NULL COMMENT 'ID Thương hiệu (Lấy theo ID từ bảng app_params)\r\n------\r\nselect ap.ID\r\nfrom app_params ap\r\nwhere ap.IS_ACTIVE = 1\r\n	and ap.TYPE = \'BRAND_TYPE\'\r\norder by ap.PAR_ORDER;',
  `PARTNER_TYPE_ID` int(11) NULL DEFAULT NULL COMMENT 'ID Loại sản phẩm hợp tác (Lấy theo ID từ bảng app_params)\r\n------\r\nselect ap.ID\r\nfrom app_params ap\r\nwhere ap.IS_ACTIVE = 1\r\n	and ap.TYPE = \'PARTNER_PRODUCT_TYPE\'\r\norder by ap.PAR_ORDER;',
  `PARTNER_SCOPE_ID` int(11) NULL DEFAULT NULL COMMENT 'ID Phạm vi hợp tác (Lấy theo ID từ bảng app_params)\r\n------\r\n',
  `DESCRIPTION` varchar(1000) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT 'Mô tả sản phẩm',
  `CREATED_DATE` datetime(0) NULL DEFAULT NULL COMMENT 'Ngày tạo',
  `CREATED_USER` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT 'ID người tạo',
  `UPDATED_DATE` datetime(0) NULL DEFAULT NULL COMMENT 'Ngày cập nhật',
  `UPDATED_USER` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT 'ID người cập nhật',
  `IS_ACTIVE` int(11) NULL DEFAULT NULL COMMENT 'Trạng thái bản ghi \r\n(0: Inactive; 1: Active)',
  PRIMARY KEY (`ID`) USING BTREE,
  UNIQUE INDEX `product_UN`(`CODE`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 14 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci ROW_FORMAT = Dynamic;

