-- ----------------------------
-- Table structure for revenue
-- ----------------------------
DROP TABLE IF EXISTS `revenue`;
CREATE TABLE `revenue`  (
  `ID` bigint(10) NOT NULL AUTO_INCREMENT,
  `CREATED_DATE` datetime(0) NULL DEFAULT NULL,
  `CREATED_USER` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL,
  `IS_ACTIVE` int(1) NULL DEFAULT NULL,
  `UPDATED_DATE` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL,
  `UPDATED_USER` bigint(10) NULL DEFAULT NULL,
  `DOC_ID` bigint(10) NULL DEFAULT NULL COMMENT 'Mã hồ sơ',
  `MONTH` int(2) NULL DEFAULT NULL COMMENT 'Tháng',
  `PRECIOUS` int(9) NULL DEFAULT NULL COMMENT 'Quý',
  `PRODUCT_ID` bigint(10) NULL DEFAULT NULL COMMENT 'ID sản phẩm',
  `PROFIT_PLAN` decimal(19, 2) NULL DEFAULT NULL COMMENT 'LNTT/DT theo phương án hợp tác',
  `PROFIT_REAL` decimal(19, 2) NULL DEFAULT NULL COMMENT 'LNTT/DT trước thuế',
  `RATIO_PLAN` double NULL DEFAULT NULL COMMENT 'Tỷ lệ doanh thu chia sẻ trước thuế/DT chia sẻ theo KH (%)',
  `RATIO_REAL` double NULL DEFAULT NULL COMMENT 'Tý lệ lợi nhuận trước thuế/kế hoạch (%)',
  `REVENUE_DATE` datetime(0) NULL DEFAULT NULL COMMENT 'Thời gian',
  `REVENUE_PLAN` decimal(19, 2) NULL DEFAULT NULL COMMENT 'Doanh thu chia sẻ với đối tác theo kế hoạch (sau VAT)',
  `REVENUE_PRODUCT` decimal(19, 2) NOT NULL COMMENT 'Doanh thu sp/dv (sau VAT)',
  `REVENUE_REAL` decimal(19, 2) NULL DEFAULT NULL COMMENT 'Doanh thu thực hiện chia sẻ với đối tác (sau VAT)',
  `REVENUE_TYPE_ID` bigint(10) NULL DEFAULT NULL,
  `YEAR` int(9) NULL DEFAULT NULL,
  `STATUS` varchar(1000) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT 'Trạng thái báo cáo doanh thu chi phí tỷ suất lợi nhuận',
  PRIMARY KEY (`ID`, `REVENUE_PRODUCT`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 193 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = 'Chi phí doanh thu tỉ suất lợi nhuận' ROW_FORMAT = Dynamic;

