  `IS_ACTIVE` int(10) NULL DEFAULT NULL,
  PRIMARY KEY (`ID`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 270 CHARACTER SET = utf8 COLLATE = utf8_vietnamese_ci COMMENT = 'Danh mục Cấu hình' ROW_FORMAT = Compact;

